description:
The 10th volume of Sweetheart's top selling series. Bratty daughter Riley Reid plans to blackmail her dad's fiancee Dana Vespoli, whom Riley is convinced is just a gold digger. The tables get turned as Dana teaches Riley a valuable lesson. Dana's best friend Eva Karera falls prey to young Kimber Day, as the girl works to distract her from Riley's blackmail scheme. Spoiled Keira Kelley tries to convince Professor Magdalene St. Michaels to raise her grade, giving the older woman the hottest incentive possible. Finally, conflicted Claire Robbins sees therapist India Summer, who helps ease the young girl's mind about many things...this steamy saga is filled with scandal, passion and the real orgasms that make Sweetheart the best in lesbian erotica.

